extern QSqlDatabase tennisTestDB;
Player::Player(QString id, QString fName, QString lName, QString dob, QString m, QString e, QString t, QString FamilyID){
    playerID = id;
    firstName = fName;
    lastName = lName;
    DOB = dob;
    mob = m;
    email = e;
    gender_id = t;
    this->FamilyID = FamilyID;
}

QSqlQueryModel* dbLoad()
{
    QSqlQueryModel *model = new QSqlQueryModel;
    QSqlQuery search(tennisTestDB);

    search.prepare("SELECT * FROM PLAYER");
    search.exec();

    if(search.isActive())
    {
        model->setQuery(search);
    }
    else
        qDebug() << " Query not active: " << search.lastError() << endl;


    return model;
}
QSqlQueryModel* Player::search(QString where)
{
    QSqlQueryModel *model = new QSqlQueryModel;
    QSqlQuery search(tennisTestDB);

    search.prepare("SELECT * FROM PLAYER " + where);
    search.exec();

    if(search.isActive())
    {
        model->setQuery(search);
        qDebug() << " Query active: " << search.executedQuery();

    }
    else
        qDebug() << " Query not active: " << search.executedQuery();

    return model;
}

QSqlQueryModel* Player::familySearch(QString where)
{
    QSqlQueryModel *model = new QSqlQueryModel;
    QSqlQuery search(tennisTestDB);

    search.prepare("SELECT * FROM FAMILY " + where);
    search.exec();

    if(search.isActive())
    {
        model->setQuery(search);
        qDebug() << " Query active: " << search.executedQuery();

    }
    else
        qDebug() << " Query not active: " << search.executedQuery();

    return model;
}

void addPlayer(Player p)								//add new player to the DB
{
    QSqlQuery insert(tennisTestDB);

    insert.prepare("INSERT INTO PLAYER (first_name,last_name,dob,mobile,email,gender_id) VALUES" +toValues(p));
    insert.exec();
    if(insert.isActive())
    {
        qDebug() << " Player Added successfully";
    }
    else
        qDebug() << " Query not active: " << insert.executedQuery() << insert.lastError() << endl;

}

QString Player::newFamilyID()
{
    QSqlQuery newID(tennisTestDB);
    newID.prepare("SELECT MAX(family_id) FROM FAMILY;");
    newID.exec();
            if(newID.isActive())
            {
                if(newID.first())
                {
                    return QString::number((newID.value(0).toInt()+1));
                }
                else
                    qDebug() << "no first value";

            }
            else
                qDebug() << " Query not active: " << newID.lastError() << endl;
}
QString toValues(Player p)
{
    return
            "('"+p.firstName+"','" +
            p.lastName+"'," +
            "STR_TO_DATE('"+p.DOB+"','%d/%m/%Y'),'" +
            p.mob+"','" +
            p.email+"','" +
            p.gender_id+"');";
}
void editPlayer(Player p)								//add new player to the DB
{
    QSqlQuery update(tennisTestDB);
    QString query = "UPDATE PLAYER SET first_name ='"
            + p.firstName   +"',"+
            "last_name ='"   + p.lastName    +"',"+
            "dob = STR_TO_DATE('"+p.DOB+"','%d/%m/%Y')," +
            "mobile ='"     + p.mob         +"',"+
            "email ='"      + p.email       +"',"+
            "gender_id ='"  + p.gender_id   +"',"+
            "family_id ='"  + p.FamilyID    +"'"+
            "WHERE id ="    + p.playerID;
    update.prepare(query);
    update.exec();

    if(update.isActive())
    {
        qDebug() << " Player Edited successfully";
    }
    else
        qDebug() << " Query not active: " << update.lastError() << endl;

}
Player getPlayer(QString id)
{
    QSqlQuery get(tennisTestDB);
    QString query = "SELECT * FROM PLAYER WHERE id = "+ id;
    get.prepare(query);
    get.exec();

    if(get.isActive())
    {
        if(get.first())
        {
            qDebug() << " Player Found successfully: ";
            return Player(get.value(0).toString(),get.value(1).toString(),get.value(2).toString(),get.value(3).toString(),get.value(4).toString(),get.value(5).toString(),get.value(6).toString(),get.value(7).toString());
        }
    }
    else
        qDebug() << " Query not active: " << get.lastError() << endl;
    return Player("","","","","","","","");
}

